// Global Styles
$LandingH1: 9rem;
$LogoH1: 6.7rem;
$Heading2: 5.1rem;
$Heading3: 3.8rem;
$Heading4: 2.8rem;
$Heading5: 2.1rem;
$Text: 1.6rem;
$Label: 1.2rem;
* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}

html {
  font-size: 62.5%;
}

body {
  font-family: "EB Garamond", serif;
}

h1 {
  font-size: $LogoH1;
  font-weight: 400;
  text-decoration: underline;
  text-decoration-skip-ink: none;
}
h2 {
  font-size: $Heading2;
  font-weight: bold;
}
h3 {
  font-size: $Heading3;
  font-weight: bold;
}
h4 {
  font-size: $Heading4;
  font-weight: bold;
}
h5 {
  font-size: $Heading5;
  font-weight: normal;
}
P {
  font-size: $Text;
  line-height: 2.4rem;
}
a {
  color: rgb(43, 43, 43);
  font-size: $Heading5;
  text-decoration: none;
  font-weight: 400;
}

li {
  list-style: none;
}

// Landing
@import "landing";

// Index
@import "index";

// About
@import "about";

// Contact
@import "contact";

// Media Queries

sources.styles/_landing.scss:
.landing {
  height: 100vh;
  width: 100vw;
  background-image: url(../img-full/landing.jpg);
  background-position: top;
  background-size: cover;
  z-index: -1;
}

.welcome {
  color: white;
  height: 100vh;
  width: 30vw;
  display: flex;
  flex-direction: column;
  margin-left: 10rem;
  align-items: center;
  h1 {
    font-size: $LandingH1;
    font-weight: 400;
    margin-top: 15rem;
    z-index: 1;
    white-space: nowrap;
  }
  h5 {
    margin-top: -1rem;
  }
  a {
    text-decoration: none;
    color: white;
    margin-top: 20%;
    align-self: center;
  }
  h4 {
    font-size: 3rem;
    font-weight: 400;
    border: 2px solid white;
    width: 15rem;
    text-align: center;
    padding: 0.5rem;
    border-radius: 3px;
  }
  hr {
    border-top: 2px solid white;
    width: 60rem;
    margin-top: -2rem;
    z-index: 0;
  }
  a:hover,
  h4:hover {
    color: #313131;
    border-color: #313131;
  }
}

// Media Queries

@media screen and (max-width: 860px) {
  .landing {
    background-image: url(../img-full/landing-mobile.jpg);
  }

  .welcome {
    width: 90%;
    margin: auto;
  }

  .welcome h1 {
    font-size: 6.7rem;
  }
}

sources.styles/_index.scss:
//Index

nav {
  width: 350px;
  height: 100vh;
  position: fixed;
  display: flex;
  flex-direction: column;
  margin: 1.5rem;
  h1 {
    font-weight: 400;
    white-space: nowrap;
    cursor: pointer;
  }
  h1 a {
    font-size: $LogoH1;
  }
  h1 a:hover {
    text-decoration: none;
  }
  h5 {
    margin-top: -1rem;
    margin-bottom: 3rem;
  }
  li {
    padding: 1rem 0rem;
  }
  hr {
    border-bottom: 1.5px solid black;
    width: 31rem;
  }
  a:hover {
    text-decoration: underline;
    color: black;
  }
  .iglink {
    text-decoration: none;
    font-size: 3px;
  }
}

.gallery {
  margin-top: 1rem;
  margin-bottom: 1rem;
  min-height: 100vh;
  margin-left: 350px;
  margin-right: 1.5rem;
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(500px, 1fr));
  grid-gap: 1rem;
}

.img-container {
  overflow: hidden;
}

.img-container img {
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: all 0.3s ease-out;
  cursor: pointer;
}

.img-container img:hover {
  transform: scale(1.1);
  opacity: 0.5;
}

.modal {
  background: rgba($color: #000000, $alpha: 0.8);
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  opacity: 0;
  pointer-events: none;
  transition: 0.5s ease-out;
}

.modal.open {
  opacity: 1;
  pointer-events: all;
}

.full-img {
  position: absolute;
  height: 90vh;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%) scale(0.5);
  transition: all 0.5s ease-out;
}

.full-img.open {
  transform: translate(-50%, -50%) scale(1);
}

.modal p {
  color: white;
  font-size: 2rem;
  position: absolute;
  bottom: 5%;
  left: 50%;
  transform: translate(-50%, -5%);
}

.mobile-nav {
  display: none;
  position: relative;
  min-height: 8vh;
}

.burger {
  display: none;
  position: absolute;
  right: 5%;
  top: 30%;
  div {
    width: 30px;
    height: 2px;
    background-color: black;
    margin: 6px;
    transition: all 0.15s ease-in;
  }
}

.drop-down {
  display: none;
  transition: translate 1s ease-in;
  width: 100vw;
  height: 100vh;
  li {
    text-align: center;
    margin: 8rem;
  }
}

// Media Queries

@media screen and (max-width: 860px) {
  nav {
    display: none;
  }
  .gallery {
    width: 90%;
    margin: auto;
    grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  }
  .full-img {
    height: auto;
    width: 95%;
  }
  .mobile-nav {
    display: flex;
    width: 100%;
  }
  .mobile-logo h1 {
    font-size: 2.8rem;
    font-weight: 400;
    text-align: center;
  }
  .mobile-logo {
    width: 80%;
    margin: 1.5rem auto;
  }
  .burger {
    display: block;
  }
  .drop-down.active {
    display: block;
    transition: translate 1s ease;
  }
  .toggle .line1 {
    transform: rotate(-45deg) translate(0px, 11px);
  }
  .toggle .line2 {
    transform: translateX(-100%);
    opacity: 0;
  }
  .toggle .line3 {
    transform: rotate(45deg) translate(0px, -11px);
  }
}

sources.styles/_about.scss:
// About Section
.about-container {
  margin-left: 350px;
  height: 100vh;
  display: flex;
  justify-content: space-evenly;
  padding-top: 5rem;
  flex-wrap: wrap;
  .bio {
    margin: 3rem;
    flex: 1 1 35rem;
  }
  .bio h3 {
    margin-bottom: 2.3rem;
  }
  .bio-photo {
    margin: 3rem;
    flex: 1 1 30rem;
  }
  .bio-photo img {
    width: 80%;
    object-fit: cover;
  }
  .bio-photo-mobile {
    display: none;
  }
}

// Media Queries

@media screen and (max-width: 860px) {
  .about-container {
    width: 90%;
    margin: auto;
    padding-top: 2rem;
    position: relative;
    margin-bottom: 3rem;
  }

  .about-container .bio {
    width: 90%;
    margin: 2rem;
  }

  .bio h3 {
    font-size: 2.8rem;
  }

  .bio-photo {
    display: none;
  }

  .about-container .bio-photo-mobile {
    display: block;
    width: 90%;
  }
  .bio-text {
    margin-bottom: 4rem;
  }
  .bio-photo-mobile img {
    object-fit: 100%;
    width: 100%;
  }
}

