// Contact Section
.contact-container {
  height: 100vh;
  margin-left: 350px;
  display: flex;
  justify-content: center;
  align-items: center;
}

.form-wrapper {
  display: flex;
  flex-direction: column;
  justify-content: center;
  div {
    padding: 1rem;
  }
  input,
  textarea {
    background: rgba($color: #f3f3f3, $alpha: 0.5);
    font-family: "EB Garamond", serif;
    border: 1px rgba($color: #000000, $alpha: 0.2) solid;
    border-radius: 3px;
    padding: 1rem;
    color: black;
    font-size: $Text;
  }
  input {
    width: 25rem;
  }
  button {
    font-family: "EB Garamond", serif;
    border: 0.5px solid black;
    background-color: white;
    padding: 1.5rem 5rem;
    margin: 1rem;
    font-size: $Text;
    text-align: center;
    border-radius: 3px;
  }
  button:hover {
    cursor: pointer;
    background-color: rgba($color: #888888, $alpha: 0.5);
  }
  .submit-button button {
    margin-left: 0rem;
  }
}

// Media Queries

@media screen and (max-width: 860px) {
  .contact-container {
    width: 90%;
    margin: auto;
    align-items: flex-start;
    margin-top: 5vh;
  }

  .form-head {
    align-self: center;
  }

  .form-wrapper {
    width: 90%;
  }
  .form-wrapper textarea {
    width: 100%;
  }
  .contact-container div {
    margin: 0;
  }

  .form-wrapper input {
    width: 100%;
  }

  .submit-button {
    display: flex;
    justify-content: center;
  }
}
